      @-webkit-keyframes spin {

      @keyframes spin {

      }
      100% {

ามรู้ทางโภชนาการ (กรณีที่มีการแสดงฉลากโภชนาการ)',1,false,''],['Q19','“การแสดงฉลากอาหาร” มีความสำคัญอย่างไร','ค. เป็นเครื่องมือในการเลือกซื้อของผู้บริโภค',1,false,''],['Q19','“การแสดงฉลากอาหาร” มีความสำคัญอย่างไร','ง. ถูกทุกข้อ',1,true,''],['Q20','ข้อใดคือความหมายของอาหารตามพระราชบัญญัติอาหาร พ.ศ. 2522','ก. วัตถุทุกชนิดที่คนกิน ดื่ม อม หรือนําเข้าสู่ร่างกาย และรวมถึงยา',1,false,''],['Q20','ข้อใดคือความหมายของอาหารตามพระราชบัญญัติอาหาร พ.ศ. 2522','ข. วัตถุเจือปนอาหาร สี และเครื่องปรุงแต่งกลิ่นรส',1,false,''],['Q20','ข้อใดคือความหมายของอาหารตามพระราชบัญญัติอาหาร พ.ศ. 2522','ค. วัตถุทุกชนิดที่คนกิน ดื่ม อม หรือนําเข้าสู่ร่างกาย ไม่รวมถึงยา วัตถุออกฤทธิ์ต่อจิตและประสาท',1,false,''],['Q20','ข้อใดคือความหมายของอาหารตามพระราชบัญญัติอาหาร พ.ศ. 2522','ง. ข้อ ข และ ค ถูก',1,true,'']]

        let questions = {}

        for (let i = 1; i < values.length; i ++) {
          let rowData = values[i]
          let key     = rowData[0]
          let title   = rowData[1]
          let option  = rowData[2]
          let point   = rowData[3]
          let correct = rowData[4]

          if (questions[key]) {
            questions[key].options.push(option)

            if (correct) questions[key].corrects.push(option) 
          }

          else {
            questions[key] = {
              id: key,
              title: title,
              options: [option],
              point: point,
              corrects: correct ? [option]:[],
              selected: [],
              disabled: false,
              correct: true,
            }
          }
        }

        questions = Object.keys(questions).map(function(key) {
          return questions[key]
        })

        return questions
      }
    </script>

    <script>
      function randomSelectArray(arr, count) {
        if (count > arr.length) count = arr.length

        let newArr = []

        let data = arr.slice()

        for (let i = 0; i < count; i ++) {
          let newItem = data.splice(Math.floor(Math.random() * data.length), 1)
          newArr = newArr.concat(newItem)
        }

        return newArr
      }
    </script>
      
    <script>
      function formatTime(seconds) {
        let h = Math.floor(seconds / 3600)
        if (h < 10) h = "0" + h 

        let m = Math.floor((seconds % 3600) / 60)
        if (m < 10) m = "0" + m 

        let s = (seconds % 3600) % 60
        if (s < 10) s = "0" + s 

        return [h, m, s].join(":")
      }
    </script>

    <script>
	  function thaiNumber(number) {
	    let arr = {'1':'๑', '2':'๒', '3':'๓', '4' : '๔', '5' : '๕', '6' : '๖', '7' : '๗', '8' : '๘', '9' : '๙', '0' : '๐'}
	    let str = number.toString()
	    for (let val in arr) {
		  str = str.split(val).join(arr[val])
	    }
	    return str
	  }
	</script>

    <script>
	  function pdfFile() {
		let time = new Date()
		let date = time.getDate()
		let thaiDate = thaiNumber(date)
		let month = time.getMonth()
		let thaiMonths = ['มกราคม','กุมภาพันธ์','มีนาคม','เมษายน','พฤษภาคม','มิถุนายน','กรกฎาคม','สิงหาคม','กันยายน','ตุลาคม','พฤศจิกายน','ธันวาคม']
		let thaiMonth = thaiMonths[month]
		let year = time.getFullYear()
		let yearNew = year + 543
		let thaiYearNew = thaiNumber(yearNew)
		let dateNew = thaiDate + ' ' + thaiMonth + ' ' + thaiYearNew
		let yearExp = year + 546
		let thaiYearExp = thaiNumber(yearExp)
		let dateExp = thaiDate + ' ' + thaiMonth + ' ' + thaiYearExp
	    let fullName = sessionStorage.getItem("name")
	    let fileName = yearNew + ' ' + thaiMonth + ' ' + date + ' - ' + fullName + '.pdf'
		
		document.getElementById('fullName').innerHTML = fullName
		document.getElementById('dateNew').innerHTML = dateNew
		document.getElementById('dateExp').innerHTML = dateExp
		document.getElementById('element-to-print').style.display = 'inline'
		
		let element = document.getElementById('element-to-print')
	    let opt = {
		  margin: 0,
		  filename: fileName,
		  image: { 
		    type: 'jpeg', 
		    quality: 0.98 
		  },
		  html2canvas: { 
		    scale: 2 
		  },
		  jsPDF: { 
		    unit: 'in', 
		    format: [11.69, 8.6], 
		    orientation: 'landscape' 
		  }
	    }
		html2pdf(element, opt)
	  }
    </script>
	
    <script>
      let data = {
        message: null,
        submitting: false,
        start: false,
        title: "แบบทดสอบความรู้หลักสูตรการอบรมผู้สัมผัสอาหาร ตามกฏกระทรวงสุขลักษณะของสถานที่จำหน่ายอาหาร พ.ศ. ๒๕๖๑",
        countDown: null,
        counter: 0,
        ID: "",
        config: {
          time: 30,
          count: 20
        },
        question: question(),
        selectedQuestions: null,
        showWelcome: true,
        showSidebar: false,
      }
    </script>

    <script>
      let computed = {
        timer: function() {
          return formatTime(this.counter)
        }
      }
    </script>

    <script>
      let methods = {
	    startMain: function() {
		  this.showWelcome = false
		},
		
        startQuiz: function() {
          if (this.ID === "") {
            Swal.fire({
              icon: "warning",
              title: "คำเตือน",
              text: "กรุณาพิมพ์ ชื่อ - สกุล ของท่านก่อนทำแบบทดสอบด้วยครับ/ค่ะ",
            })
          }

          else {
            this.start = true

            this.counter = this.config.time * 60

            let selectedQuestions = randomSelectArray(this.question, this.config.count)

            selectedQuestions.forEach(function(item) {
              item.disabled = false
              item.selected = []
              item.correct = true
            })
            
            this.selectedQuestions = selectedQuestions
            
            this.countDown = setInterval(function() {
              this.counter -= 1 

              if (this.counter === 0) {
                clearInterval(this.countDown)

                this.endQuiz()
              }

            }.bind(this), 1000)
          }
        },

        endQuiz: function() { 
          this.start = false

          this.submitting = true

          clearInterval(this.countDown)

          let totalScore = 0

          let tempArray 
          
          this.selectedQuestions.forEach(function(q) {
            if (typeof(q.selected) !== "object") tempArray = [q.selected] 

            else tempArray =  [... q.selected] 

            if (tempArray.join() == q.corrects.join()) {
              q.correct = true
              totalScore += q.point
            }

            else q.correct = false 
            
            q.disabled = true
          })

          try {
            this.submitting = true
			
			let percentage = (totalScore / this.config.count) * 100
			let scorePass = this.config.count * 0.8
			
            if (percentage >= 80) {
			  sessionStorage.setItem("name", this.ID)
			  
              Swal.fire({
                icon: 'success', 
                title: 'ผลการทดสอบ', 
                html: `<span>${this.ID} ทำคะแนนได้ ${totalScore}/${this.config.count} คะแนน<br/>(ทำคะแนนได้มากกว่า ${scorePass} คะแนน จึงถือว่า <b>"ผ่าน"</b>)<br/><br/><button class="w3-button w3-round w3-theme-d4 w3-mobile" onclick="pdfFile()">ดาวน์โหลดไฟล์เกียรติบัตร</button></span>`,
				confirmButtonText: 'OK'
              }).then(function(result) {
			    if (result.isConfirmed) {
				  document.getElementById('fullName').innerHTML = ''
				  document.getElementById('dateNew').innerHTML = ''
				  document.getElementById('dateExp').innerHTML = ''
				  document.getElementById('element-to-print').style.display = 'none'
				}
			  })
            } 

            else {
			  sessionStorage.removeItem("name")
			  
              Swal.fire({
                icon: 'error', 
                title: 'ผลการทดสอบ', 
                html: `<span>${this.ID} ทำคะแนนได้ ${totalScore}/${this.config.count} คะแนน<br/>(ทำคะแนนได้น้อยกว่า ${scorePass} คะแนน จึงถือว่า <b>"ไม่ผ่าน"</b>)</span>`,
				confirmButtonText: 'OK'
              })
            }

            this.ID = ""
			
			this.submitting = false
          }

          catch (error) {
            console.log(error.message)

            this.submitting = false

            this.message = {
              type: "Error",
              message: error.message
            }
			
			sessionStorage.removeItem("name")
          }

        },

        closeMessageBox: function() {
          this.message = null
        }
      }
    </script>   

    <script>
	  document.getElementById('element-to-print').style.display = 'none'
	  
      new Vue({
        el: "#app",
        data,
        computed,
        methods
      })
    </script>
  </body>
